import React from 'react';
import { Card, CardContent, CardMedia, Typography, Button } from '@mui/material';

const DogCard = ({ dog, toggleFavorite, isFavorite }) => {
    return (
        <Card sx={{ maxWidth: 345, margin: 'auto', boxShadow: 3 }}>
            <CardMedia
                component="img"
                height="200"
                image={dog.img || '/placeholder-image.jpg'}
                alt={dog.name || 'Dog'}
            />
            <CardContent>
                <Typography variant="h6">{dog.name || 'Unknown'}</Typography>
                <Typography>Breed: {dog.breed || 'Unknown'}</Typography>
                <Typography>Age: {dog.age || 'Unknown'}</Typography>
                <Typography>Location: {dog.zip_code || 'Unknown'}</Typography>
                <Button
                    variant="outlined"
                    color={isFavorite ? 'error' : 'primary'}
                    onClick={() => toggleFavorite(dog)}
                    sx={{ marginTop: '10px' }}
                >
                    {isFavorite ? 'Unfavorite' : 'Favorite'}
                </Button>
            </CardContent>
        </Card>
    );
};

export default DogCard;
